export default () => (
  <>
    <div className="wrapper">
      <h1>sunemaute.com</h1>
      <main>
        <p>
          Sie nennen mich cool, sie nennen mich hip.
          <br />
          Laber mich nicht an, oder Du bist rip.
          <br />
          Sie nennen mich cool, sie nennen mich knorke.
          <br />
          Sei mal nicht so h√§sslich, wenn ich mit Dir talke.
        </p>
        <img src="https://public.jonathanwieben.com/sune.jpg" />
      </main>
    </div>
    <style jsx global>{`
      main {
        display: flex;
        align-items: center;
        justify-content: space-around;
        padding: 20px;
      }
      h1 {
        color: #ff0008;
        text-align: center;
        font-size: 55px;
        margin-top: 0;
      }
      p {
        font-size: 25px;
        color: orange;
      }
      img {
        width: 30%;
      }
      .wrapper {
        padding-top: 20px;
        height: 100vh;
        width: 100vw;
        background-image: url("https://public.jonathanwieben.com/black-orange-red-fire.jpeg");
        background-position: center;
        background-repeat: no-repeat;
        background-size: cover;
      }
      body {
        margin: 0;
        padding: 0;
      }
      @media (max-width: 700px) {
        main {
          flex-direction: column;
        }
        img {
          width: 280px;
        }
      }
    `}</style>
  </>
);
